                <h1 id="main-title">Settings Page</h1>
                <h2 id="sub-title">Currently in Progress!</h2>
            </header>
            <body id="settings-body">

            </body> */}

            <div id="NavBar">
                <NavBar />
            </div>

            <h1 id="sub-title">Profile Page</h1>

            <div className="settings-navigation-container">
                <SettingsNavigation />
            </div>
            <Container>
                <SettingsNavigation />
            </Container>
        </div>

    );
}

export default OrgSettingsPage;
